import React from "react";
import { Header } from "../components/Header";
import { Sidebar } from "../components/Sidebar";
import { Cards } from "../components/Cards";

export const Dashboard = () => {
  return (
    <div>
     
      <Header />  
      <Sidebar />

      <div className="elementsContainer"> 
        <Cards/>
      
      
      </div>
      
     
    </div>
  );
};
